import React, { useEffect } from "react";
import "./Showcase.css";
import { Slides } from "./Slides";
import Card from "./Card";
import Particles from "react-tsparticles";
const headerParticles = {
  fpsLimit: 60,
  interactivity: {
    detectsOn: "canvas",
    events: {
      onClick: { enable: true, mode: "push" },
      onHover: { enable: true, mode: "repulse" },
      resize: true,
    },
    modes: {
      bubble: {
        distance: 400,
        duration: 2,
        opacity: 0.8,
        size: 40,
      },
      push: { particles_nb: 4 },
      repulse: { distance: 100, duration: 0.4 },
    },
  },
  particles: {
    color: { value: "#ffffff" },
    links: {
      color: "#ffffff",
      distance: 150,
      enable: true,
      opacity: 0.5,
      width: 1,
    },
    move: {
      bounce: false,
      direction: "none",
      enable: true,
      outMode: "bounce",
      random: false,
      speed: 2,
      straight: false,
    },
    number: { density: { enable: true, value_area: 800 }, value: 80 },
    opacity: { value: 0.5 },
    shape: { type: "circle" },
    size: { random: true, value: 5 },
  },
  detectRetina: true,
};

export const educationParticles = {
  fpsLimit: 60,
  interactivity: {
    detectsOn: "canvas",
    events: {
      resize: { enable: true, mode: "bubble" },
    },
    modes: {
      bubble: {
        distance: 400,
        duration: 2,
        opacity: 0.8,
        size: 40,
      },
    },
  },
  particles: {
    color: { value: "#f3f4f6" },
    move: {
      bounce: false,
      direction: "none",
      enable: true,
      outMode: "bounce",
      random: false,
      speed: 1,
      straight: false,
    },
    number: { density: { enable: true, value_area: 1000 }, value: 50 },
    opacity: { value: 1 },
    shape: { type: "circle" },
    size: { random: true, value: 10 },
  },
  detectRetina: true,
};

const Showcase = () => {
  const slides = Slides;
  const [index, setIndex] = React.useState(0);
  const slidesLength = slides.length;
  const nextHandler = () => {
    if (index < slides.length - 1) {
      setIndex(index + 1);
    } else {
      setIndex(0);
    }
  };

  const prevHandler = () => {
    if (index > 0) {
      setIndex(index - 1);
    } else {
      setIndex(slides.length - 1);
    }
  };
  return (
    <div className="showcaseContainer">
      <Particles
        options={{
          fullScreen: {
            enable: true,
            zIndex: 0,
          },
          particles: {
            number: {
              value: 400,
              limit: 500,
              density: {
                enable: true,
                value_area: 800,
              },
            },
            color: {
              value: "#ffffff",
            },
            shape: {
              type: "circle",
              stroke: {
                width: 0,
                color: "#000000",
              },
              polygon: {
                nb_sides: 5,
              },
              image: {
                src: "images/github.svg",
                width: 100,
                height: 100,
              },
            },
            opacity: {
              value: 0.5,
              random: true,
              anim: {
                enable: true,
                speed: 1,
                opacity_min: 0.5,
                sync: false,
              },
            },
            // size: {
            //   value: 30,
            //   random: true,
            //   anim: {
            //     enable: true,
            //     speed: 10,
            //     size_min: 10,
            //     sync: false
            //   }
            // },
            line_linked: {
              enable: true,
              distance: 100,
              color: "#ffffff",
              opacity: 1,
              width: 1,
            },
            move: {
              enable: true,
              speed: 3,
              direction: "none",
              random: false,
              straight: false,
              out_mode: "out",
              bounce: false,
              attract: {
                enable: false,
                rotateX: 600,
                rotateY: 1200,
              },
            },
          },
          // interactivity: {
          //   detect_on: "canvas",
          //   events: {
          //     onHover: {
          //       enable: true,
          //       mode: "bubble",
          //       parallax: {
          //         enable: false,
          //         force: 60,
          //         smooth: 10
          //       }
          //     },
          //     onClick: {
          //       enable: true,
          //       mode: "push"
          //     },
          //     resize: true
          //   },
          //   modes: {
          //     grab: {
          //       distance: 400,
          //       lineLinked: {
          //         opacity: 1
          //       }
          //     },
          //     bubble: {
          //       distance: 400,
          //       size: 100,
          //       duration: 2,
          //       opacity: 1,
          //       speed: 2
          //     },
          //     repulse: {
          //       distance: 200
          //     },
          //     push: {
          //       particles_nb: 4
          //     },
          //     remove: {
          //       particles_nb: 2
          //     }
          //   }
          // },
          backgroundMask: {
            enable: false,
            cover: {
              color: {
                value: {
                  r: 0,
                  g: 0,
                  b: 0,
                },
              },
            },
          },
          retina_detect: true,
          fps_limit: 60,
        }}
      />

      <button className="nextSlide" onClick={nextHandler}>
        ≻
      </button>
      <button className="prevSlide" onClick={prevHandler}>
        ≺
      </button>
      <div className="slidesContainer">
        {index - 1 > 0 ? (
          <Card slide={slides[index - 1]} className="leftSlide" />
        ) : (
          <Card slide={slides[slidesLength - 1]} className="leftSlide" />
        )}

        <Card slide={slides[index]} className="centerSlide" />

        {index + 1 < slidesLength ? (
          <Card slide={slides[index + 1]} className="leftSlide" />
        ) : (
          <Card slide={slides[0]} className="leftSlide" />
        )}
      </div>
    </div>
  );
};
export default Showcase;
